window.bookSummaryJSON = "<p><b>Binge the complete series in one place!</b></p> <p><b>Magic is dangerous.</b></p> <p>I should know. It got me a thirty-year sentence scrubbing toilets for a scumbag wizard.<br> <br> My only hope is the Unleashing, a ceremony that unlocks the dormant powers of magical descendants when we turn eighteen. Since my mom was a lowly psychic, I don’t expect to be blessed with much more than the ability to forecast the weather. But when the sorcerers unlock my magic, all hell breaks loose.<br> <br> Turns out, I’m not a wizard, witch, or even a sorcerer. I’m…something else.<br> <br> Because of my unique abilities, I’m required to attend the Academy of Sorcery until I learn to harness and control my magic. Not only that, but the three sexiest and most powerful sorcerers on campus are assigned to guard me night and day. Jackpot, right? Not quite.<br> <br> Turns out these guys aren’t too happy with the arrangement, and they show it by making my life hell. That’s just the beginning of my troubles. The mean-girl squad declares open season on me, a mysterious woman attacks me every time I step off campus, and my professor is too hot for his own good. And when it’s time to find a weapon to help me master my abilities, my magic chooses… a spork.<br> <br> It’s going to be a long year.<br> <br> <i>*This is a complete Reverse Harem series that includes 4 full-length novels: Unleashing Trials, Fallen Master, Shadow Magic, and Secret Power. <br> Perfect for listeners who enjoy:<br> +enemies-to-lovers<br> +college academies<br> +student-teacher forbidden romance<br> +badass heroine who holds her own against alpha males<br> +fun, fast-paced listens intended for ages 18+</i></p>"; 
